import React from "react";
import { useState } from "react";
import { withRouter } from "react-router";
import { Button } from "antd";

function SignupUi(props) {
  const [first_name, setFirstname] = useState("");
  const [last_name, setLastname] = useState("");
  const [email, setEmail] = useState("");
  const [gender, setGender] = useState("");
  const [mob_no, setNumber] = useState("");
  const [Role, setRole] = useState("");
  const [Package, setPackage] = useState("");
  const [Address, setAddress] = useState("");

  // const [password, setPassword] = useState("");

  function handleClick() {
    let data = {
      first_name,
      last_name,
      email,
      gender,
      mob_no,
      Role,
      Package,
      Address,
    };
    console.log(data);
    fetch("http://localhost:3001/users", {
      method: "POST",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
      body: JSON.stringify(data),
    }).then((result) => {
      result.json().then((resp) => {
        console.warn("resp", resp);
      });
    });
    props.history.push("/loginUi");
  }

  // const url = "http://localhost:3001/";

  // function handleClick1 = () => {
  //   fetch(url)
  //     .then((res) => res.json())
  //     .then((url) => {
  //       setState();
  //     });
  // };

  // function handleClick() {
  //   localStorage.setItem("name", JSON.stringify(username));
  //   localStorage.setItem("role", JSON.stringify(role));
  //   localStorage.setItem("email", JSON.stringify(email));
  //   localStorage.setItem("password", JSON.stringify(password));
  //   localStorage.setItem("number", JSON.stringify(number));
  //   if (username !== "" && email !== "" && password !== "" && number !== "") {
  //     props.history.push("/loginUi");
  //   }
  // }

  return (
    <div className="main">
      <div className="sub-main">
        <div>
          <h1>SignUp Page</h1>

          <div>
            <label className="form-label" htmlFor="Firstname">
              Firstname
            </label>
            <br />
            <input
              type="text"
              placeholder="Enter your first name"
              className="name"
              onChange={(event) => setFirstname(event.target.value)}
            />
          </div>
          <br />

          <div>
            <label className="form-label" htmlFor="Lastname">
              Lastname
            </label>
            <br />
            <input
              type="text"
              placeholder="Enter your last name"
              className="name"
              onChange={(event) => setLastname(event.target.value)}
            />
          </div>
          <br />

          <div>
            <label className="form-label" htmlFor="Email">
              Email address:
            </label>
            <br />
            <input
              type="text"
              placeholder="Enter your ID or email"
              className="name"
              onChange={(event) => setEmail(event.target.value)}
            />
          </div>
          <br />

          <div>
            <label className="form-label" htmlFor="Gender">
              Gender
            </label>
            <br />
            <input
              type="text"
              placeholder="Enter your gender"
              className="name"
              onChange={(event) => setGender(event.target.value)}
            />
          </div>
          <br />

          <div>
            <label className="form-label" htmlFor="Number">
              Mobile no.:
            </label>
            <br />
            <input
              type="number"
              placeholder="Enter your mobile no."
              className="name"
              onChange={(event) => setNumber(event.target.value)}
            />
          </div>
          <br />

          <div>
            <label className="form-label" htmlFor="Role">
              Role:
            </label>
            <br />
            <input
              type="text"
              placeholder="Enter your Position"
              className="name"
              onChange={(event) => setRole(event.target.value)}
            />
          </div>
          <br />

          <div>
            <label className="form-label" htmlFor="Package">
              Package
            </label>
            <br />
            <input
              type="text"
              placeholder="Enter your Package"
              className="name"
              onChange={(event) => setPackage(event.target.value)}
            />
          </div>
          <br />

          <div>
            <label className="form-label" htmlFor="Address">
              Address
            </label>
            <br />
            <input
              type="text"
              placeholder="Enter your address"
              className="name"
              onChange={(event) => setAddress(event.target.value)}
            />
          </div>
          <br />

          {/* <div className="second-input">
            <label className="form-label" htmlFor="password">
              Password:
            </label>
            <br />
            <input
              type="password"
              placeholder="Enter your password"
              className="name"
              onChange={(event) => setPassword(event.target.value)}
            />
          </div>
          <br /> */}

          <div className="Submit-button">
            <Button type="primary" onClick={handleClick}>
              Sign Up
            </Button>
          </div>
        </div>
      </div>
    </div>
  );
}
export default withRouter(SignupUi);
